import React, { useState } from 'react';
import '../assets/style.css';
import { Link, useNavigate } from 'react-router-dom';
import { useFormInputValidation } from "react-form-input-validation";


export default function Felling() {
  const [fields, errors, form] = useFormInputValidation({
    email_address: "",
    password: "",
  }, {
    email_address: "required|email",
    password: "required"
  });
  const navigate = useNavigate();
  const [authenticated, setauthenticated] = useState(sessionStorage.getItem(sessionStorage.getItem("authenticated") || false) â€‚);

  // useEffect(() => {
  //   if (form.isValidForm) {
  //     // console.log(fields, errors, form);
  //     // Perform api call here
  //     alert('f');
  //   }
  // }, [])
  const onSubmit = async (event) => {
    const isValid = await form.validate(event);
    if (isValid) {

      if(fields.email_address==="rohit@gmail.com"){
        sessionStorage.setItem("authenticated", true);
        navigate("/admin/adminHome");
      }

      // console.log(fields, errors);
      // Perform api call here
    }
  }
    // const handleSubmit = (event) => {
    //   const form = event.currentTarget;
    //   if (form.checkValidity() === false) {
    //     event.preventDefault();
    //     event.stopPropagation();
    //   }
    //   setValidated(true);
    // }

  return (
    <div>
      <div className="dashboard-ecommerce">
    <div className="container-fluid dashboard-content custom-container">
        <div className="row">
            <div className="col-xl-12 col-lg-12 col-md-12 col-sm-12 col-12">
                <div className="page-header">
                    <h2 className="pageheader-title">Tree Felling</h2>
                    <div className="page-breadcrumb">
                        <nav aria-label="breadcrumb">
                            <ol className="breadcrumb">
                                <li className="breadcrumb-item"><a href="<?php echo base_url(); ?>dashboard" className="breadcrumb-link">Dashboard</a></li>
                                <li className="breadcrumb-item active" aria-current="page">About</li>
                            </ol>
                        </nav>
                    </div>
                </div>
            </div>
        </div>
        <div className="card">
            <div className="card-body">
                <div className="form-popup" style={{marginLeft: "20px"}}>
                    <div align="center">
                        <div id="success"></div>
                        <div id="error"></div>

                    </div>
                    <form id="about_form"  method="post" action="<?php echo base_url(); ?>about/savedata">
                      <input type="hidden" name="<?=$csrf['name'];?>" value="<?=$csrf['hash'];?>" />
                        <div className="row">
                            <div className="col-xl-6 col-lg-6 col-md-6 col-sm-6 col-6">
                                <div className="form-group">
                                    <label>Select Page: <span className="red-text">*</span></label>
                                    <select name="page_type" id="page_type" className="form-control" required="required">
                                        <option value="">Select Page</option>
                                        <option value="about_us">About us</option>
                                        <option value="about_patiala">About Patiala</option>
                                        <option value="university_act">University Act</option>
                                        <option value="approval">Approval</option>
                                        <option value="grievance_redressal">Grievance Redressal</option>
                                    </select>
                                </div>
                            </div>

                            <div className="col-xl-6 col-lg-6 col-md-6 col-sm-6 col-6">
                                <div className="form-group">
                                    <label>Select Language: <span className="red-text">*</span></label>
                                    <select name="language_id" id="language_id" className="form-control" required="required">
                                        <option value="">Select Language</option>
                                       
                                    </select>
                                </div>
                            </div>
                            <div className="col-xl-12 col-lg-12 col-md-12 col-sm-12 col-12">
                                <label>Enter About: <span className="red-text">*</span></label>
                                <div className="form-group">
                                    <div id="summernote">
                                    </div>
                                </div>
                            </div>
                            <div className="col-xl-2 col-lg-2 col-md-2 col-sm-2 col-2">
                                <button type="submit" id="SaveRecord" className="btn btn-primary btn-lg btn-block edit_faculty_btn" data-id="">Update</button>                    
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </div>
     </div>
</div>
    </div>
  )
}
